import {
    List,
} from 'immutable';
import {
    ADD_NOTIFICATION,
    CLOSE_NOTIFICATION,
    INotification,
    NotificationsAction,
} from '../actions/queue';

export interface IImmutableQueueState extends List<INotification> {}

const initialState = List<INotification>([
    {
        application: '1',
        body: 'This is a test notification. Here you can put more text than in the title.',
        icon: '/images/logo.svg',
        id: '1',
        image: 'data:image/jpeg;base64,',
        timestamp: 1586680089000,
        title: 'Test Notification',
    },
    {
        actions: [
            {
                action: 'test',
                title: 'Test',
            },
            {
                action: 'test2',
                title: 'Test 2',
            },
        ],
        application: '2',
        body: 'This is a test notification. Here you can put more text than in the title.',
        id: '2',
        timestamp: 1586621561000,
        title: 'Test Notification',
    },
]);

function instancesReducer(
    state: IImmutableQueueState = initialState,
    action: NotificationsAction,
): IImmutableQueueState {

    switch (action.type) {
        case ADD_NOTIFICATION:
            return state.unshift(action.payload.notification);
        case CLOSE_NOTIFICATION:
            return state.filter((instance) => {
                if (!instance) {
                    return false;
                }

                return (instance.id !== action.payload.id);
            }) as IImmutableQueueState;
    }

    return state;
}

export default instancesReducer;
